function playNote(note) {
    /* if (!note.includes("piano-mp3")) {
        url = "./piano-mp3/" + note + ".mp3"
    } */
    // console.log("trying to play: ", { note })
    /* var audio
    if (note_audios[note]) {
        audio = note_audios[note]; 
    } else {
        audio = new Audio(note);
    } */
    const url = (note.includes("piano-mp3")) ? note : "./piano-mp3/" + note + ".mp3"
    const audio = (notes_audios[note]) ? notes_audios[note] : new Audio(url) // controversial ternary operators 
    // if (note_audios[note]) audio = note_audios[note] else audio =  new Audio(note)
    // const audio = new Audio(note);
    audio.play();
    notes_audios[note] = audio // is unneccessary for already assigned  
    /* setTimeout( () => {
        audio.pause()
    }, 500)  */
    // ok. so set a timeout... no... the real midi way 
    // would be to only pause when you get a note off!, 
    // no timeouts needed 
    // and the brilliant thing is that you won't need... 
    // i'm just going to ignore the ui for now and try to get the 
    // parsing to play nicely with this playing 
    // more complexity isn't needed right now 
}

function pauseNote(note) {
    const url = (note.includes("piano-mp3")) ? note : "./piano-mp3/" + note + ".mp3"
    const audio = (notes_audios[note]) ? notes_audios[note] : new Audio(url) // controversial ternary operators 
    audio.pause();
    delete notes_audios[note]
}

